import React, { useState } from "react";

import "./index.css";

export const App = () => {

  let [count, setCount] = useState(1);
  
  const IncNum = () => {
    setCount(count++)
  };
  return (
    <>
      <h1 className="heading">{count}</h1>
      <button onClick={IncNum}> Click </button>
    </>
  );
};
